//平滑最小值
float smin( float a, float b, float k )
{
    k = max(0.00001,k);
    float h = max(k-abs(a-b),0.0);
    return min(a, b) - h*h*0.25/k;
}

//平滑最大值
float smax( float a, float b, float k )
{
    k = max(0.00001,k);
    float h = max(k-abs(a-b),0.0);
    return max(a, b) + h*h*0.25/k;
}

//整圆atan
float atan2(float y, float x){
    if(x>0.0){
        return atan(y/x);
    }
    else if(x<0.0){
        if(y>=0.0){
            return atan(y/x) + PI;
        }else{
            return atan(y/x) - PI;
        }
    }
    else{// x==0
        return sign(y) * PI / 2.0;
    }
}

//根据normal获取天空的UV
vec2 skyUV(vec3 normal) {
    vec2 uv;
    float phi = atan2(normal.z, normal.x);
    float theta = asin(normal.y);
    uv.x = 1.0 - (phi + PI) / (2.0 * PI);
    uv.y = (theta + PI/2.0) / PI;
    uv.y = 1.0 - uv.y;
    return uv;
}

//获取一个平面的有向距离
float planSDF(vec3 p,float z) {
    return p.z - z;
}

//获取一个圆的有向距离
float sphereSDF(vec3 p,vec3 c, float r) {
    return length(p - c) - r;
}

//方块的有向距离
float boxSDF(vec3 p,vec3 b)
{
    vec3 d = abs(p) - b;
    return min( max(max(d.x,d.y),d.z),0.0) + length(max(d,0.0));
}

//获取偏移点值
vec2 getOffsetPoint(vec2 point,vec2 off){
    point.x = (floor(ut2Size.x * point.x) + off.x) / ut2Size.x;
    point.y = (floor(ut2Size.y * point.y) + off.y) / ut2Size.y;
    return point;
}

float imgValue(vec2 uv){
    vec2 bl = uv - getOffsetPoint(uv,vec2(0,0));
    bl.x *= ut2Size.x;
    bl.y *= ut2Size.y;
    float p00 = texture(uTex2,getOffsetPoint(uv,vec2(0,0))).r;
    float p01 = texture(uTex2,getOffsetPoint(uv,vec2(0,1))).r;
    float p10 = texture(uTex2,getOffsetPoint(uv,vec2(1,0))).r;
    float p11 = texture(uTex2,getOffsetPoint(uv,vec2(1,1))).r;
    float p0 = p00 * (1.0 - bl.y) + p01 * bl.y;
    float p1 = p10 * (1.0 - bl.y) + p11 * bl.y;

    //float re = p00;
    //float re = texture(uTex2,uv).r - 0.5;
    float re = p0 * (1.0 - bl.x) + p1 * bl.x;
    return re;
}

//根据图片计算有向距离
float imgSDF(vec3 p,float depth){
    //范围外处理
    if(p.x < -1.0 || p.x > 1.0 || p.y < -1.0 || p.y > 1.0)
        return boxSDF(p,vec3(0.9,0.9,depth));
    return max(texture(uTex2,p.xy / 2.0 + 0.5).r,abs(p.z) - depth);
}

vec3 imgNormal(vec3 p,float depth){
    vec2 uv = p.xy / 2.0 + 0.5;
    //return vec3(texture(uTex2,p.xy / 2.0 + 0.5).r,0.0,0.0);
    vec2 nm = vec2(
        texture(uTex2,uv + vec2(2.0 / ut2Size.x,0)).r - texture(uTex2,uv + vec2(-2.0 / ut2Size.x,0)).r,
        texture(uTex2,uv + vec2(0,2.0 / ut2Size.x)).r - texture(uTex2,uv + vec2(0,-2.0 / ut2Size.x)).r
    );
    if(abs(p.z) > depth - 0.001 || (nm.x == 0.0 && nm.y == 0.0))
        return normalize(vec3(0,0,p.z));
    return normalize(vec3(nm,0.0));
}

