//获取点的法向
vec3 PointNormal(vec3 p) {
    return normalize(vec3(
        MapSDF(vec3(p.x + PIX_SPACING, p.y, p.z)) - MapSDF(vec3(p.x - PIX_SPACING, p.y, p.z)),
        MapSDF(vec3(p.x, p.y + PIX_SPACING, p.z)) - MapSDF(vec3(p.x, p.y - PIX_SPACING, p.z)),
        MapSDF(vec3(p.x, p.y, p.z  + PIX_SPACING)) - MapSDF(vec3(p.x, p.y, p.z - PIX_SPACING))
    ));
}

//命中阴影
bool ShadowHitTo(vec3 pos,vec3 step,float minv,int max_step){
    Ray ray;
    ray.pos = pos;
    ray.step = step;
    //当前投射长度
    float len = 0.0;
    //循环投射
    for (int i = 0; i < max_step; i++) {
        //获取有向距离
        float dist = MapSDF(ray.pos + ray.step * len);
        //命中成功
        if (dist < MIN_HIT_LENGTH)
            return true;
        //限制最小步进长度
        dist = min(max( dist, minv),0.05);
        //步进
        len += dist;
        //如果过大则退出
        if(len > MAX_SHADOW_LENGTH)
            return false;
    }
    //指定次数内没命中
    return false;
}

//命中阴影
bool ShadowHitTo(vec3 pos,vec3 step){
    return ShadowHitTo(pos,step,0.002,MAX_SHADOW_STEP_NUM);
}

//命中目标
bool RayHitTo(inout Ray ray,inout float len,inout int mat){
    //当前投射长度
    len = 0.0;
    //循环投射
    for (int i = 0; i < MAX_STEP_NUM; i++) {
        //获取有向距离
        float dist = MapSDF(ray.pos + ray.step * len,mat);
        //命中成功
        if (dist < MIN_HIT_LENGTH)
            return true;
        //限制最小步进长度
        dist = min(max( dist, 0.001),0.03);
        //步进
        len += dist;
        if(ShadowHitTo(ray.pos + ray.step * len,light_dir,0.02,80))
            ray.fog += dist;
        //如果过大则退出
        if(len > MAX_RAY_LENGTH)
            return false;
    }
    //指定次数内没命中
    return false;
}

